import React from 'react'
import styled from 'styled-components';

const InfoBox = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
`

const Text = styled.span`
  font-size : 20px;
  padding : 0 100px 0 50px;
  width : 600px;
  height: 100px;
`;

const Myimg = styled.span`
    width: 280px;
    height: 280px;
    padding-right: 200px;
    img {

    }
`;

function MyPage1() {
    return (
        <InfoBox>
            <span>
                <br />
                <Text>이름  : 오예진</Text><br /><br />
                <Text>핸드폰 </Text><br /><br />
                <Text>이메일 </Text><br /><br />
            </span>
            <Myimg>
                <img src="images/mypage.jpg" alt="이미지"/>
            </Myimg>
        </InfoBox>
    )
}

export default MyPage1
